import React from "react";
import './Footer.css';

export default function Footer() {
    return (
        <div className="footer-container">
          <div className="footer-parent">
              <img src = {require ('../../../src/assets/Home/shape-bg.png')} alt = 'footer' />
          </div>
        </div>
    );
}
